import React from 'react';
import { useUser } from './User';
import CartStyles from './styles/CartStyles';
import Supreme from './styles/Supreme';

const Cart = () => {
  const me = useUser();
  if (!me) return null;
  return (
    <CartStyles open>
      <header>
        <Supreme>{me.name}</Supreme>
      </header>
    </CartStyles>
  );
};

export default Cart;
